import { useState } from 'react';
import axios from 'axios';

function App() {
  const [quote, setQuote] = useState('');
  const getQuote = () => {
    axios.get('https://api.quotable.io/random')
    .then(res => {
      console.log('res: ', res)
      // {quote ? <p>{quote}</p> : null}
      setQuote(res)
    })
    .catch(error => {
      console.log(error)
    })
  }
  return (
    <div className="App">
      <button className="openModalBtn" onClick={getQuote}>Obtener token virtual</button>
    </div>
  );
}

export default App;
